window.bookSummaryJSON = "<p>Time. Truth. Life. </p><p>There is weakness in all when lies are told but the strength in each is what we must behold. Can our Chosen One find her way back from the deception and chaos that surrounds her or is this the life of a trapped girl, broken and lost forever? </p><p>A worldwide search might be on the cards but what if the girl they're looking for was never meant to be found? These are the questions both sides face in a race against time, truth and the life they are all trying to save. The battle against evil continues in the most unlikely of places and emotions run wild in this next instalment of the Afterlife saga. Will you take the plunge with our characters and delve deeper into the world of Afterlife, further than you've ever gone before? </p>"; 
